import React, { useState } from "react";
import sendFormSql from "../services/SendFormSql";

const AddTrip = () => {
  const [trip, setTrip] = useState({
    country: "",
    year: "",
    month: "",
    duration: "",
    cost: "",
    km_travelled: "",  // Cambié el nombre a km_travelled
    hotel: "",
  });

  const [errors, setErrors] = useState({});

  const validateForm = () => {
    const errors = {};
    if (!trip.country.trim()) errors.country = "Country is required.";
    if (!trip.year || isNaN(trip.year) || trip.year <= 0)
      errors.year = "Year must be a valid number.";
    if (!trip.month || isNaN(trip.month) || trip.month < 1 || trip.month > 12)
      errors.month = "Month must be a number between 1 and 12.";
    if (!trip.duration || isNaN(trip.duration) || trip.duration <= 0)
      errors.duration = "Duration must be a positive number.";
    if (!trip.cost || isNaN(trip.cost) || trip.cost <= 0)
      errors.cost = "Cost must be a positive number.";
    if (!trip.km_travelled || isNaN(trip.km_travelled) || trip.km_travelled <= 0)
      errors.km_travelled = "Kilometers travelled must be a positive number.";  // Cambié el nombre a km_travelled
    if (!trip.hotel.trim()) errors.hotel = "Hotel is required.";
    return errors;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const validationErrors = validateForm();
    if (Object.keys(validationErrors).length > 0) {
      setErrors(validationErrors);
      return;
    }
    try {
      const response = await sendFormSql.addTrip(trip);
      console.log("Trip added:", response);
      setTrip({ country: "", year: "", month: "", duration: "", cost: "", km_travelled: "", hotel: "" });
      setErrors({});
    } catch (error) {
      console.error("Error adding trip:", error);
    }
  };

  return (
    <form onSubmit={handleSubmit} style={{ maxWidth: "500px", margin: "auto", padding: "20px", display: "flex", flexDirection: "column" }}>
      <input
        type="text"
        placeholder="Country"
        value={trip.country}
        onChange={(e) => setTrip({ ...trip, country: e.target.value })}
        style={inputStyle}
      />
      {errors.country && <p style={errorStyle}>{errors.country}</p>}

      <input
        type="number"
        placeholder="Year"
        value={trip.year}
        onChange={(e) => setTrip({ ...trip, year: e.target.value })}
        style={inputStyle}
      />
      {errors.year && <p style={errorStyle}>{errors.year}</p>}

      <input
        type="number"
        placeholder="Month (1-12)"
        value={trip.month}
        onChange={(e) => setTrip({ ...trip, month: e.target.value })}
        style={inputStyle}
      />
      {errors.month && <p style={errorStyle}>{errors.month}</p>}

      <input
        type="number"
        placeholder="Duration (days)"
        value={trip.duration}
        onChange={(e) => setTrip({ ...trip, duration: e.target.value })}
        style={inputStyle}
      />
      {errors.duration && <p style={errorStyle}>{errors.duration}</p>}

      <input
        type="number"
        placeholder="Cost (USD)"
        value={trip.cost}
        onChange={(e) => setTrip({ ...trip, cost: e.target.value })}
        style={inputStyle}
      />
      {errors.cost && <p style={errorStyle}>{errors.cost}</p>}

      <input
        type="number"
        placeholder="Kilometers Travelled"
        value={trip.km_travelled}  // Cambié el nombre a km_travelled
        onChange={(e) => setTrip({ ...trip, km_travelled: e.target.value })}  // Cambié el nombre a km_travelled
        style={inputStyle}
      />
      {errors.km_travelled && <p style={errorStyle}>{errors.km_travelled}</p>}  {/* Cambié el nombre a km_travelled */}

      <input
        type="text"
        placeholder="Hotel"
        value={trip.hotel}
        onChange={(e) => setTrip({ ...trip, hotel: e.target.value })}
        style={inputStyle}
      />
      {errors.hotel && <p style={errorStyle}>{errors.hotel}</p>}

      <button type="submit" style={buttonStyle}>Add Trip</button>
    </form>
  );
};

// Estilos
const inputStyle = {
  padding: "10px",
  margin: "10px 0",
  fontSize: "16px",
  borderRadius: "5px",
  border: "1px solid #ccc",
};

const errorStyle = {
  color: "red",
  fontSize: "12px",
};

const buttonStyle = {
  padding: "10px",
  fontSize: "16px",
  backgroundColor: "#4CAF50",
  color: "white",
  border: "none",
  borderRadius: "5px",
  cursor: "pointer",
};

export default AddTrip;
